import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awTreeRenderFunction } from 'js/AwTreeService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwTreeService', () => import('js/AwTreeService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awTreeRenderFunction",
            "deps": "js/AwTreeService"
        }
    },
    "data": {
        "selectedNode": {},
        "_isRefreshNeeded": false
    },
    "props": {
        "tree": {
            "type": "object"
        },
        "name": {
            "type": "string"
        }
    },
    "messages": {},
    "conditions": {},
    "lifecycleHooks": {
        "render": "render"
    },
    "onEvent": [],
    "i18n": {},
    "_viewModelId": "AwTree",
    "_uniqueViewModelId": "AwTree",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awTreeRenderFunction, undefined, ctxImportObj );

export default Component;
